column8:
ミニホットビーズシリーズ！<br>突起のついた専用ボードにビーズを並べて、透明アイロンシートをかぶせてアイロンで温めれば可愛いキーホルダーの出来上がり♪<br>ビーズをつまむミニピンセットに、ビーズを簡単に並べられる実物大カラー図案が付いているので、作業もらくちんです。<br>1キットで2個作れます。<br><br>◆ホビータイム: 約40分(1ヶ)<br>◆サイズ: 約縦9cm×横4cm(キーホルダー金具を含む)<br>◆キット内容：ミニホットビーズ、ボード、ミニピンセット、丸カン、キーホルダー金具、透明アイロンシート、ラインストーン<br>◆用意するもの：ボンド、ペンチ、目打ち、アイロン、三角トレイ(あると便利です)<br><br>※ロットによって色が変わる場合がございます。<br>※写真は作品例です。<br>
※見本画像と現物の色が多少異なる場合がございます。<br>
<p>※メーカー希望小売価格はメーカーカタログに基づいて掲載しています。<br>

<img src="http://image.rakuten.co.jp/yuzawaya-2/cabinet/evidence/374-03-047_evidence.jpg" border="0" width="300" alt="evidence"></p><style type="text/css">
