ミニホットビーズシリーズ！<br>突起のついた専用ボードにビーズを並べて、透明アイロンシートをかぶせてアイロンで温めれば可愛いマグネットの出来上がり♪<br>ビーズをつまむミニピンセットに、ビーズを簡単に並べられる実物大カラー図案が付いているので、作業もらくちんです。<br>1キットで3つ作る事ができます。<br><br>◆ホビータイム：約40分(1ヶ)<br>◆サイズ：約縦4cm×横4cm<br>◆キット内容：ミニホットビーズ、ボード、ミニピンセット、マグネット、フェルト、透明アイロンシート、ラインストーン<br>※ロットによって色が変わる事があります<br>◆用意するもの：ボンド、はさみ、アイロン、三角トレイ(あると便利です)<br><br>※ロットによって色が変わる場合がございます。<br>※写真は作品例です。<br>
※見本画像と現物の色が多少異なる場合がございます。<br>
<p>※メーカー希望小売価格はメーカーカタログに基づいて掲載しています。<br>

<img src="http://image.rakuten.co.jp/yuzawaya-2/cabinet/evidence/374-03-047_evidence.jpg" border="0" width="300" alt="evidence"></p><style type="text/css">
