気軽にカンタンに本革を使ったおしゃれなプチチャームが作れます！<br>
コラージュはじめてさんでも、わかりやすいポイントレシピ付き！<br>
コラージュペーパーやアンティークパーツを使ってオリジナルチャームにも・・・
<br><br>
◆難易度：初級<br>
◆サイズ（約）：約4.5×3.5（ボールチェーン省く　一番大きいパーツサイズ <br>
◆キット内容（素材）：牛革（本革）、コラージュペーパー（紙）、コラージュシート（オレフィン系樹脂）、丸カン（銅）、チャーム（亜鉛合金）等<br>
◆用意するもの：はさみ、平ヤットコ、アイロン、アイロン台、あて布、針（先のとがったもの）
<br><br>
※画像は商品見本です。実際の商品とサイズ・パッケージ内容などが多少異なる場合があります。　<br>
※モニターによって実物のお色と若干異なる場合がございます。<style type="text/css">
