大人気！指にはめて使うルーペ。
両手を使いたい時にルーペが欲しくなる。そんな場面で大変便利な商品です。<br>

メガネだけでは見えにくいビーズや針の糸通し、刺繍など指先の細かい作業に大活躍！<br><br>
女性目線で作られた『軽くて・かわいい､指にはめて使うルーペ』プレゼントしても大変喜ばれます。<br>
ルーペは角度を変えたり取り外す事が出来ます。<br>
シリコーンゴムの割リングだから太い指にも、細い指にも優しくフィットします。<br><br>
◆製品サイズ　:W36mm×D60mm×H77mm<br>
◆重量      　:7g<br>
◆材質(本体)　:シリコーンゴム<br>
◆原産国(本体):日本<br><br>

◆材質(レンズ):アクリル(本体)プラスチック(レンズ)<br>
◆レンズ径　　:30mm<br>
◆レンズ倍率　:3倍<br><br>

※写真と実際の商品の色とは多少異なる場合があります。<br /><br />※メーカー希望小売価格はメーカーカタログに基づいて掲載しています。(カタログは消費税5%時のものです)<br /><img src="http://image.rakuten.co.jp/yuzawaya-2/cabinet/evidence/364-77-001_evidence.jpg" width="400" border="0" /><br /><style type="text/css">
